var version = '1.0'
var pid_variables_version = flow.get('pid_variables_version')
if (pid_variables_version !== version){
    flow.set('pid_variables_version', version)
    node.warn('Variables have been created!')
    var zone = []
    var zone_count = 2
    for (let index = 0; index < zone_count; index++) {
        var obj1 = { gain: { Kp: 0, Ki: 0, Kd: 0 }, time: { PB: 0, Ti: 0, Td: 0 } }
        var tuned = Object.create(obj1)
        var obj2 = { gain: { Kp: 0, Ki: 0, Kd: 0 }, time: { PB: 0, Ti: 0, Td: 0 } }
        var accepted = Object.create(obj2)
        var obj3 = { tuned, accepted }
        var settings = Object.create(obj3)
        var obj4 = { setpoint: 0, control: 0, process: 0 }
        var parameters = Object.create(obj4)
        var obj5 = { active: false, setpoint: 0 }
        var autotune = Object.create(obj5)
        zone.push({ id: '', autotune, parameters, settings })
    }
    var pid = { selected_zone: 0, zone }
    global.set('pid', pid)
    msg.payload = { pid }
    return msg;
}

